# check if all files are jpg in python


import os

import string
arr = os.listdir("./images")

listerror = []


def contains_whitespace(s):
    """[function for checking whitespaces in string]

    Args:
        s ([string]): [string which needs to be checked for white space ]

    Returns:
        [Boolean]: [ True if whitespace in string ]
    """
    return True in [c in s for c in string.whitespace]


# checking for typy for whitespace in image names
for xray in arr:
    if contains_whitespace(xray):
        listerror.append(xray)


